import React from "react";
import { connect } from "react-redux";
import {getSemester} from "../../reduser/data-reduser.js";
import Semester from "./Semester.jsx";


class SemesterContainer extends React.Component {
    componentDidMount() {
        this.props.getSemester()
    }
    render() {
        return <Semester semester={this.props.semester} />
    }
}


const mapStateToProps = (state) => ({
  semester: state.data.semester,
});

export default connect(mapStateToProps, { getSemester })(SemesterContainer);
